import { __decorate } from "tslib";
import __NG_CLI_RESOURCE__0 from "./list.component.html?ngResource";
import __NG_CLI_RESOURCE__1 from "./list.component.css?ngResource";
import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';
import { environment } from 'src/environments/environment';
let ListComponent = class ListComponent {
    constructor(http) {
        this.http = http;
        this.baseUrl = environment.baseUrl + 'api/login/';
    }
    ngOnInit() {
        this.getAllList();
    }
    getAllList() {
        this.http.get(this.baseUrl + 'getAllList')
            .subscribe(res => {
            console.log(res);
            this.allClassList = res;
        }, err => {
            alert('Error');
        });
    }
};
ListComponent.ctorParameters = () => [
    { type: HttpClient }
];
